syntax = "proto3";

import "FeedHeadButton.proto";
import "FeedHeadImg.proto";
import "FeedHeadSymbol.proto";

message FeedHeadComponent {
    FeedHeadImg image_data = 1;
    repeated FeedHeadSymbol main_data = 2;
    repeated FeedHeadSymbol extra_data = 3;
    string schema = 4;
    FeedHeadButton button = 5;
}
